import React from 'react';

const HomePage = () => {
  return (
    <div className="max-w-4xl mx-auto bg-white shadow-md rounded-lg overflow-hidden">
      <div className="p-6">
        <h1 className="text-3xl font-bold text-gray-800 mb-4">Bienvenido a la Home Page</h1>
        <p className="text-gray-600 leading-relaxed">
          Esta es la página principal de nuestra aplicación. Hemos diseñado una interfaz moderna y limpia para mejorar tu experiencia de usuario.
        </p>
        <div className="mt-6 flex space-x-4">
          <button className="bg-green-600 text-white px-4 py-2 rounded-md hover:bg-green-700 transition duration-300">
            Comenzar
          </button>
          <button className="bg-gray-200 text-gray-800 px-4 py-2 rounded-md hover:bg-gray-300 transition duration-300">
            Más Información
          </button>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
